import React, { Component } from "react";
import Project from "./project";

class Projects extends Component {
  constructor() {
    super();
    this.state = {
      projectList: []
    };
  }

  componentDidMount() {
    fetch("https://bpm-projects-api.azurewebsites.net/projects/", {
      method: 'GET',
      headers: new Headers({
        "Token": "eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJpc3MiOiJpb2V0LmNvbSIsInN1YiI6InNlY3JldCIsInJvbGUiOiJhZG1pbiIsImV4cCI6MTUzOTIwMzIwOX0.eKskpb4fPuDdTMESjtjyFYOgfvECM8D2ueOsoS5Zx4A",
        'Content-Type': 'application/json'
      })
    })
      .then(results => {
        console.log(results)
        return results.json();
      })
      .then(data => {
        console.log(data);
        this.setState({ projectList: data.results });
      }).catch(err => {
        console.log(err)
      });
  }

  render() {
    return <Project projectList={this.state.projectList} />;
  }
}

export default Projects;
